INSERT INTO `errors` (`error_id`, `error_title`, `example_uri`, `example_n3`, `description`, `error_parent`, `is_leaf`) VALUES
(1, 'Accuracy', '', '', 'Accuracy', 0, 0),
(2, 'Triple incorrectly extracted', '', '', 'Triple incorrectly extracted', 1, 0),
(3, 'Object value is incorrectly extracted', 'http://dbpedia.org/resource/Oregon_Route_238', 'dbpprop:map "238.0"^^<http://dbpedia.org/datatype/second> .', 'The resource is about a "Oregon Route 238", which is a state highway and the property map has the value 238 which is incorrect. This is because Wikipedia has an attribute map, which has the image name as the value: map=Oregon Route 238.svg. The dbprop only extracted the value 238 from his attribute value and gave it a dataype second. ', 2, 1),
(4, 'Object value is incompletely extracted', 'http://dbpedia.org/resource/Dave_Dobbyn', 'dbpprop:dateOfBirth "3"^^<http://www.w3.org/2001/XMLSchema#int> .', 'In this example, only the day of birth of a person is extracted and mapped to the dateofBirth property when it should have been the entire date ie. day,month and year. ', 2, 1),
(5, 'Special template not properly recognized', 'http://dbpedia.org/page/328_Gudrun', 'dbpprop:auto "yes"@en .', 'Many Wikipedia articles have an indication on top of the page, which says: "This article does not cite any references or sources." referring to the fact that it is unreferenced. This information is stored in an attribute "Unreferenced stub|auto=yes". DBpedia thus extracts this attribute auto and value yes as a triple, which is not meaningful by itself and should not be extracted. ', 2, 1),
(6, 'Datatype problems', '', '', 'Datatype problems', 1, 0),
(7, 'Datatype incorrectly extracted', 'http://dbpedia.org/resource/Torishima_%28Izu_Islands%29', 'foaf:name, @en', 'The datatype of a literal is incorrectly mapped. In this case, the name is not in English but has the datatype @en. ', 6, 1),
(8, 'Implicit relationship between attributes', '', '', 'Incorrect mapping - Implicit relationship between attributes', 1, 0),
(9, 'One fact is encoded in several attributes ', 'http://dbpedia.org/resource/Barlinek', 'dbpprop:postalCodeType Postal code', 'In several cases, one fact in Wikipedia is encoded in several attributes. In this example, the value of the postal code of the town of Barlinek is encoded in two attributes "postal_code_type = Postal code" and "postal_code = 74-320". DBpedia extracts both of these attributes as is when it should have combined the attributes together to produce only the triple "http://dbpedia.org/resource/Barlinek dbpprop:postalCode 74" and not extract the postal code type as "postal code". ', 8, 1),
(10, 'Several facts are encoded in one attribute', 'http://dbpedia.org/resource/Picathartes', 'dbpedia-owl:synonym "Galgulus Wagler, 1827 (non Brisson, 1760: preoccupied)"@en . ', 'In this example, the triple is not incorrect but in fact contains two pieces of information in it. Only the first word is the synonym, the rest is a citation or reference. In Wikipedia, it is represented as "synonyms = ''''Galgulus'''' <small>Wagler, 1827 (''''non'''' [[Mathurin Jacques Brisson|Brisson]], 1760: [[Coracias|preoccupied]])</small><br />". Therefore, since several facts (synonym and reference, in this case) are encoded in one attribute, DBpedia should recognize and separate these facts into several triples. ', 8, 1),
(11, 'Attribute value computed from another attribute value', 'http://dbpedia.org/page/Barlinek', 'dbpprop:populationDensityKm "auto"@en . ', 'In Wikipedia, the attribute "population_density_km2" = auto means that this property is computed automatically by dividing population by area. But, DBpedia doesn''t do the conversion and extract the value "auto" as it is. ', 8, 1),
(12, 'Relevancy', '', '', 'Relevancy', 0, 0),
(13, 'Irrelevant information extracted', '', '', 'Irrelevant information extracted', 12, 0),
(14, 'Extraction of attributes containing layout information', 'http://dbpedia.org/resource/L%C3%A6rdals%C3%B8yri', 'dbpprop:pushpinLabelPosition "bottom"@en .', 'Information related to layout of a page in Wikipedia, such as position of an image caption, position or size of an image, position of the co-ordinates are irrelevant when extracted in DBpedia. ', 13, 1),
(15, 'Redundant attributes value', 'http://dbpedia.org/resource/Niedersimmental_District', '"dbpedia-owl:thumbnail, foaf:depiction, dbpprop:imageMap Karte Bezirk Niedersimmental 2007.png"""', 'Three properties: dbpedia-owl:thumbnail, foaf:depiction, and dbpprop:imageMapRedundant refer to the same subject "Karte_Bezirk_Niedersimmental_2007.png" and are thus redundant in DBpedia. ', 13, 1),
(16, 'Image related information', 'http://dbpedia.org/resource/Three-banded_Plover', 'dbpprop:imageCaption At Masai Mara National Reserve, Kenya', 'Extraction of an image caption and name of the image are irrelevant when extracted in DBpedia. ', 13, 1),
(17, 'Other irrelevant information ', 'http://dbpedia.org/resource/Chestnut-banded_Plover', 'dbpprop:downloaded 2007-07-24 (xsd:date)', 'The date when the article is retrieved is extracted as a triple. This information is not present in Wikipedia''s Infobox but it refers to the date on which a link in the references was retrieved and therefore should not be extracted for this resource. ', 13, 1),
(18, 'Representational - Consistency', '', '', 'Representational Consistency', 0, 0),
(19, 'Representation of number values', 'http://dbpedia.org/resource/Drei_Fl%C3%BCsse_Stadion', 'dbpprop:seatingCapacity "20"^^<http://www.w3.org/2001/XMLSchema#int> .', 'In Wkipedia, the seating capacity has the value "20.000", but the extractor is stopped by the period and does not include "000". ', 18, 1),
(20, 'Single double-quote inside literal value', 'http://dbpedia.org/resource/Arthur_Jensen', 'dbpprop:workInstitution "Editorial boards of Intelligence and ''''Personality and Individual Differences"@en .', 'in Wkipedia: work_institution = Editorial boards of ''''[[Intelligence (journal)|Intelligence]]'''' and ''''[[Personality and Individual Differences]] , which has the error of not completing the double quotes. Thus, instead of extracting two triples, it extracts the entire value as one. ', 18, 1),
(21, 'External websites (URLs)', 'http://dbpedia.org/page/Canaan_Valley', 'foaf:homepage <http://www.nature.nps.gov/nnl/Registry/USA_Map/States/West%20Virginia/NNL/CV/index.cfm> .', 'Links to external websites or external data sources are either incorrect or they do not show any information or are expired. ', 27, 1),
(22, 'Interlinks with other datasets (URIs)', '', '', 'Interlinks with other datasets (URIs)', 27, 0),
(23, 'Links to wikimedia', 'http://dbpedia.org/page/Wizard_of_New_Zealand', 'foaf:depiction <http://upload.wikimedia.org/wikipedia/commons/c/c4/Christchurchwizard.jpg> .', 'Links to wikimedia', 22, 1),
(24, 'Links to Freebase', 'http://dbpedia.org/page/ChaalBaaz', 'dbpprop:hasPhotoCollection http://www4.wiwiss.fu-berlin.de/flickrwrappr/photos/ChaalBaaz', 'Links to Freebase', 22, 1),
(25, 'Links to geospecies ', 'http://dbpedia.org/resource/Balkan_Mole', 'owl:sameAs <http://lod.geospecies.org/ses/LfBGE>.', 'Links to geospecies ', 22, 1),
(26, 'Links generated via flickr wrapper', 'http://dbpedia.org/page/ChaalBaaz', 'dbpprop:hasPhotoCollection http://www4.wiwiss.fu-berlin.de/flickrwrappr/photos/ChaalBaaz', 'Links generated via flickr wrapper', 22, 1),
(27, 'Interlinking - Coherency', '', '', 'Interlinking - Coherency', 0, 0);
